        <section class="aboutus">
            <div class="container">
                <div class="heading heading-center">
                    <h4 class="title">WHAT WE ARE</h4></div>
                <div class="row">
                    <div class="col-md-12" align="center">
						<p>TROCKO is Indias fastest growing technology driven logistics company. TROCKO was established in the year 2015 with the aim to fill-in severe lacunae in the logistics market back then, and empower the clients with reliable and innovative solutions to positively influence their productivity.</p>
						
						<p>Recognized for the cost-effective, hassle-free, and swift & safe delivery of goods across key locations in India, we house an impressive fleet of vehicles. When professional service is assumed and reliable delivery is the key, TROCKO is your ideal logistics partner. No wonder, we are the preferred transportation service for some of the Fortune&nbsp;500&nbsp;companies.</p>
						
						<p>Our expertise includes door-to-door pick-up and delivery of your goods, whether to a corporate, industrial, retail or residential customer. We transport lock, stock and barrel right from timber or electronic goods to frozen & processed foods, and fresh fruits & vegetables. TROCKO vehicles have in-built technology to take the best of care and handling of your goods even under extreme road and weather conditions.</p>
						
						<p>We have flexible business models that best suit your logistical requirements.</p>
						
					</div>
